import styled from "styled-components";

const NavbarWrapper = styled.div`
  height: 50px;
  display: flex;

  &:hover {
    background-color: lightcyan;
  }
`;

const NavbarItem = styled.div`
  margin-right: 10px;
  cursor: pointer;
`;

export { NavbarWrapper, NavbarItem };
